import { withStyles } from "@material-ui/core/styles";

export default withStyles(theme => {
  const colors = theme.palette.colors;

  return {
    container: {
      background: colors.green,
      width: "100vw"
    },
    logo: {
      display: "flex",
      flexDirection: "row",
      fontSize: "500px"
    }
  };
});
